import ImgDsDark from 'assets/img/ds-dark.svg';
const Footer = () => {
    return (
        <footer className="footer mt-auto py-3 bg-dark">
            <div className="container">
             <p className="text-light">App desenvolvido por <a href="https://github.com/PatriciaRuffino" target="_blank" rel="noreferrer">Patricia Ruffino</a></p>
             <p className="text-light"> Contato <a href="https://www.linkedin.com/in/patriciaruffino/" target="_blank" rel="noreferrer">Linkedin</a> </p>
            <p className="text-light"><small><strong>Semana Spring React</strong><br/>
      Evento promovido pela escola DevSuperior: <a href="https://instagram.com/devsuperior.ig" target="_blank" rel="noreferrer">@devsuperior.ig</a></small></p>
            </div>
        </footer>

    );

  }

  export default Footer;
